import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';

const ShowVolunteerList = () => {

    const [register, setRegister] = useState([])
    useEffect(() => {
        fetch('http://localhost:4000/items')
        .then(res => res.json())
        .then(data => setRegister(data))

    }, [])

    return (
        <div>
            <h3>you have {register.length} items</h3>
            {
                register.map(register => <li>name:{register.displayName}email:{register.email}regiterDate:{register.enterDate}</li>)
            }

        </div>
    );
};

export default ShowVolunteerList;
